import React from 'react';
import DashboardCard from '../components/DashboardCard';
import './Dashboard.css';

// Import Material UI icons
import PeopleIcon from '@mui/icons-material/People';          
import BookOnlineIcon from '@mui/icons-material/BookOnline';  
import AttachMoneyIcon from '@mui/icons-material/AttachMoney';
import CardTravelIcon from '@mui/icons-material/CardTravel';

// Import Recharts
import {
  BarChart, Bar, XAxis, YAxis, Tooltip, ResponsiveContainer, LineChart, Line, CartesianGrid, Legend
} from 'recharts';

// Dummy data for graphs
const revenueData = [
  { month: 'Jan', revenue: 320000 },
  { month: 'Feb', revenue: 280000 },
  { month: 'Mar', revenue: 350000 },
  { month: 'Apr', revenue: 300000 },
  { month: 'May', revenue: 375400 },
];

const userData = [
  { month: 'Jan', users: 1800 },
  { month: 'Feb', users: 2000 },
  { month: 'Mar', users: 2200 },
  { month: 'Apr', users: 2400 },
  { month: 'May', users: 2430 },
];

export default function Dashboard() {
  return (
    <div className="page dashboard-page">
      <h2>Admin Dashboard</h2>

      {/* Top Cards */}
      <div className="grid">
        <DashboardCard 
          title="Total Users" 
          value="2,430" 
          subtitle="Active this month: 312" 
          icon={<PeopleIcon style={{ fontSize: 40, color: "#4B0082" }} />} 
        />
        <DashboardCard 
          title="Active Bookings" 
          value="128" 
          subtitle="Today: 12" 
          icon={<BookOnlineIcon style={{ fontSize: 40, color: "#FF1493" }} />} 
        />
        <DashboardCard 
          title="Revenue (Monthly)" 
          value="â‚¹3,75,400" 
          subtitle="Growth: 8.3%" 
          icon={<AttachMoneyIcon style={{ fontSize: 40, color: "#228B22" }} />} 
        />
        <DashboardCard 
          title="Top Package" 
          value="Dubai Luxury" 
          subtitle="Booked 54 times" 
          icon={<CardTravelIcon style={{ fontSize: 40, color: "#FF8C00" }} />} 
        />
      </div>

      {/* Graphs Section */}
      <div className="charts">
        <div className="chart-card">
          <h3>Monthly Revenue</h3>
          <ResponsiveContainer width="100%" height={300}>
            <BarChart data={revenueData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Bar dataKey="revenue" fill="#228B22" barSize={40} />
            </BarChart>
          </ResponsiveContainer>
        </div>

        <div className="chart-card">
          <h3>User Growth</h3>
          <ResponsiveContainer width="100%" height={300}>
            <LineChart data={userData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Line type="monotone" dataKey="users" stroke="#4B0082" strokeWidth={3} />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>
    </div>
  );
}
